    function copyToClipboard(str) {
        const el = document.createElement('textarea');
        let storeContentEditable = el.contentEditable;
        let storeReadOnly = el.readOnly;
        el.value = str;
        el.contentEditable = true;
        el.readOnly = false;
        el.setAttribute('readonly', false);
        el.setAttribute('contenteditable', true);
        el.style.position = 'absolute';
        el.style.left = '-9999px';
        document.body.appendChild(el);
        const selected = document.getSelection().rangeCount > 0 ? document.getSelection().getRangeAt(0) : false; 
        el.select(); 
        el.setSelectionRange(0, 999999);
        document.execCommand('copy');
        document.body.removeChild(el);
        if (selected) {
            document.getSelection().removeAllRanges();
            document.getSelection().addRange(selected);
        }
        el.contentEditable = storeContentEditable;
        el.readOnly = storeReadOnly;
    }
    function createTable() {
        const abbreviated = data.map(item => { return {abbr: item.lastname.trim().substring(0, 2), count: parseInt(item.count, 10)}});
        const uniqueAbbreviations = abbreviated.reduce((a, c) => (a[c.abbr] = a[c.abbr] ? (a[c.abbr].count += c.count, a[c.abbr]) : c, a), {});
        const uniqueAbbreviationsSorted = Object.values(uniqueAbbreviations).sort((a, b) => b.count - a.count);
        const address = document.getElementById('osoite').value;
        let tableHtml = `<table class="table table-striped table-bordered table-sm">${uniqueAbbreviationsSorted.reduce((c, o) => c += `<tr><td><span>${o.abbr}*, ${address}</span><button class="copy btn btn-secondary btn-sm float-right">kopioi</button></td></tr>`, '')}</table>`;
        document.getElementById('placeholder').innerHTML = tableHtml;
        document.querySelectorAll('.copy').forEach((el) => {
            el.addEventListener('click', (event) => {
                let textNode = el.previousElementSibling;
                copyToClipboard(textNode.textContent);
                textNode.style.setProperty("text-decoration", "line-through");
            });
        })
    }
    </script>

<div class="container">

        <input id="osoite" type="text" class="form-control" value="Katuosoite 1, Helsinki" aria-describedby="basic-addon2">
        <div class="input-group-append">
          <button class="btn btn-primary" type="button" onclick="createTable()">Luo lista</button>
        </div>
    </div>
    <div id="placeholder"></div>
</div>
